    <style>
        @page {
            size: A4;
            margin: 0;

            margin: 0;
            padding: 0;
        }
        .a4-page {
            width: 210mm;
            height: 297mm;
            position: relative;
            page-break-after: always;
            margin: 0;
            padding: 0;
            background: white;
            display: block !important;

            position: absolute;

        .photo-placeholder img {
            width: 100%;
            height: 100%;
            object-fit: contain;
        }
        .edit-overlay, .page-delete-btn {
            display: none !important;
        }
        @media print {
            body {
                width: 210mm;
                height: 297mm;
            }
            .a4-page {
                page-break-after: always;
            }
        }
    </style>
